{
  "env": {
    "browser": true,
    "jquery": true,
    "node": true,
    "es6": true
  },
  "globals": {
    "expect": true,
    "it": true,
    "describe": true,
    "beforeEach": true,
    "afterEach": true
  },
  "parserOptions": {
    "ecmaVersion": 6
  },
  "rules": {
    "camelcase": 2,
    "eqeqeq": 2,
    "indent": [
      2,
      2,
      {
        "SwitchCase": 1
      }
    ],
    "no-use-before-define": [
      2,
      {
        "functions": false
      }
    ],
    "no-caller": 2,
    "new-cap": 0,
    "quotes": [
      2,
      "single"
    ],
    "no-unused-vars": 2,
    "strict": [
      2,
      "function"
    ],
    "no-extend-native": 2,
    "wrap-iife": [
      2,
      "any"
    ],
    "no-empty": 2,
    "no-plusplus": 2,
    "no-undef": 2,
    "linebreak-style": 0,
    "max-depth": [
      2,
      4
    ],
    "no-loop-func": 2,
    "complexity": [
      2,
      13
    ],
    "max-len": [
      2,
      {
        "code": 120,
        "ignoreComments": true
      }
    ],
    "max-params": [
      2,
      5
    ],
    "curly": [
      2,
      "all"
    ],
    "keyword-spacing": [
      2,
      {}
    ],
    "one-var": [
      2,
      "never"
    ],
    "array-bracket-spacing": [
      2,
      "never",
      {}
    ],
    "space-in-parens": [
      2,
      "never"
    ],
    "key-spacing": [
      2,
      {
        "beforeColon": false,
        "afterColon": true
      }
    ],
    "quote-props": [
      2,
      "as-needed"
    ],
    "space-infix-ops": 2,
    "space-unary-ops": [
      2,
      {
        "words": false,
        "nonwords": false
      }
    ],
    "no-implicit-coercion": [
      2,
      {
        "boolean": false,
        "string": true,
        "number": true
      }
    ],
    "no-with": 2,
    "no-multiple-empty-lines": 2,
    "brace-style": [
      2,
      "1tbs",
      {
        "allowSingleLine": true
      }
    ],
    "eol-last": 2,
    "no-trailing-spaces": 2
  }
}

const gulp = require('gulp');
const eslint = require('gulp-eslint');
const jasmine = require('gulp-jasmine');

gulp.task('test', () => {
  'use strict';
  return gulp.src('test/**/*.spec.js')
    .pipe(jasmine());
});

gulp.task('lint', ()=> {
  'use strict';
  return gulp.src(['src/**/*.js', 'test/**/*.js'])
    .pipe(eslint())
    .pipe(eslint.format())
    .pipe(eslint.failAfterError());
});

gulp.task('build', gulp.parallel(['lint', 'test']));

{
  "name": "javascript-algorithms",
  "version": "0.0.0",
  "description": "Implementations of different computer science algorithms",
  "main": "index.js",
  "directories": {
    "test": "test"
  },
  "devDependencies": {
    "@jeremyckahn/minami": "^1.3.1",
    "gh-pages": "^1.1.0",
    "gulp": "^4.0.2",
    "gulp-eslint": "^3.0.1",
    "gulp-jasmine": "^2.0.1",
    "jsdoc": "3.5.5",
    "live-server": "^1.2.0"
  },
  "scripts": {
    "build": "gulp build",
    "test": "gulp test",
    "deploy": "npm run doc:build && gh-pages -d dist -b gh-pages",
    "doc": "npm run doc:build && npm run doc:view",
    "doc:build": "jsdoc -c doc-config.json",
    "doc:view": "live-server dist --port=9124"
  },
  "repository": {
    "type": "git",
    "url": "git://github.com/mgechev/javascript-algorithms"
  },
  "author": "@mgechev",
  "license": "MIT",
  "bugs": {
    "url": "https://github.com/mgechev/javascript-algorithms/issues"
  },
  "homepage": "https://github.com/mgechev/javascript-algorithms"
}
